import Header from "../src/components/Header/Header";
import React from "react";
import Menu from "../src/components/Menu/Menu";

function Speakers() {
    return (
        <div>
            <Header />
            <Menu />
            <img src='images/searchbar.git'/>
            <Speakers />
            <img src='images/footer.png'/>
        </div>
    );
}
export default Speakers;
